[ModTitle("ItemSpawner")]
[ModDescription("ItemSpawner allows you to spawn items, animals or landmarks with a nice Menu.")]
[ModAuthor("TeKGameR950")]
[ModIconUrl("https://i.imgur.com/5U3P6sp.png")]
[ModWallpaperUrl("https://i.imgur.com/81tKPri.png")]
[ModVersionCheckUrl("https://raftmodding.com/api/v1/mods/itemspawner/version.txt")]
