    TMP_InputField modded_amountinputfield;

    public IEnumerator Start()
    {
        AssetBundleCreateRequest request = AssetBundle.LoadFromMemoryAsync(Convert.FromBase64String(embeddedAssetBundle.data));
        yield return request;
        asset = request.assetBundle;
        menu = Instantiate(asset.LoadAsset<GameObject>("ItemSpawnerCanvas"), transform).GetComponent<Canvas>();
        menu.transform.Find("Background").Find("Tabs").Find("GameItems").GetComponent<Button>().onClick.AddListener(() => SelectTab("GameItems"));
        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("Searchbar").GetComponent<TMP_InputField>().onValueChanged.AddListener((t) => { gameitems_searchterm = t; InitGameItemsTab(); });
        menu.transform.Find("Background").Find("Tabs").Find("ModdedItems").GetComponent<Button>().onClick.AddListener(() => SelectTab("ModdedItems"));
        menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("Searchbar").GetComponent<TMP_InputField>().onValueChanged.AddListener((t) => { moddeditems_searchterm = t; InitModdedItemsTab(); });

        menu.transform.Find("Background").Find("Topbar").Find("CloseButton").GetComponent<Button>().onClick.AddListener(() =>
        {
            isShown = false;
            menu.GetComponent<CanvasGroup>().alpha = isShown ? 1 : 0;
            menu.GetComponent<CanvasGroup>().interactable = isShown;
            menu.GetComponent<CanvasGroup>().blocksRaycasts = isShown;
            RAPI.ToggleCursor(isShown);
        });

        game_amountinputfield = menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("AmountInputField").GetComponent<TMP_InputField>();
        modded_amountinputfield = menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("GiveCategory").Find("AmountInputField").GetComponent<TMP_InputField>();

        game_amountinputfield.onValueChanged.AddListener((t) => { CurrentAmount = int.Parse(t); });
        modded_amountinputfield.onValueChanged.AddListener((t) => { CurrentAmount = int.Parse(t); });

        menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("GiveCategory").Find("GiveButton").GetComponent<Button>().onClick.AddListener(() =>
        {
            GiveItem(CurrentItem, CurrentAmount);
        });

        menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("GiveCategory").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() =>
        {
            SpawnItem(CurrentItem, CurrentAmount);
        });

        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("GiveButton").GetComponent<Button>().onClick.AddListener(() =>
        {
            GiveItem(CurrentItem, CurrentAmount);
        });

        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() =>
        {
            SpawnItem(CurrentItem, CurrentAmount);
        });

        menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("GiveCategory").Find("StackButton").GetComponent<Button>().onClick.AddListener(() =>
        {
            CurrentAmount = CurrentItem.settings_Inventory.StackSize;
            modded_amountinputfield.text = CurrentAmount.ToString();
        });

        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("StackButton").GetComponent<Button>().onClick.AddListener(() =>
        {
            CurrentAmount = CurrentItem.settings_Inventory.StackSize;
            game_amountinputfield.text = CurrentAmount.ToString();
        });

        menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("GiveCategory").Find("-Button").GetComponent<Button>().onClick.AddListener(() =>
        {
            CurrentAmount = int.Parse(menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("GiveCategory").Find("AmountInputField").GetComponent<TMP_InputField>().text) - 1;
            modded_amountinputfield.text = CurrentAmount.ToString();
        });

        menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("GiveCategory").Find("+Button").GetComponent<Button>().onClick.AddListener(() =>
        {
            CurrentAmount = int.Parse(menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("GiveCategory").Find("AmountInputField").GetComponent<TMP_InputField>().text) + 1;
            modded_amountinputfield.text = CurrentAmount.ToString();
        });

        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("-Button").GetComponent<Button>().onClick.AddListener(() =>
        {
            CurrentAmount = int.Parse(menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("AmountInputField").GetComponent<TMP_InputField>().text) - 1;
            game_amountinputfield.text = CurrentAmount.ToString();
        });

        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("+Button").GetComponent<Button>().onClick.AddListener(() =>
        {
            CurrentAmount = int.Parse(menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("AmountInputField").GetComponent<TMP_InputField>().text) + 1;
            game_amountinputfield.text = CurrentAmount.ToString();
        });

        menu.transform.Find("Background").Find("Tabs").Find("Animals").GetComponent<Button>().onClick.AddListener(() => SelectTab("Animals"));
        menu.transform.Find("Background").Find("Tabs").Find("Islands").GetComponent<Button>().onClick.AddListener(() => SelectTab("Islands"));
        ItemPrefabEntry = asset.LoadAsset<GameObject>("ItemSlot");
        SelectTab("GameItems");

        menu.transform.Find("Background").Find("Menus").Find("Animals").Find("KillButton").GetComponent<Button>().onClick.AddListener(() =>
        {
            Network_Entity[] array = FindObjectsOfType<Network_Entity>();
            Network_Entity currentEntity = null;
            float currentDistance = 999999f;
            foreach (Network_Entity network_Entity in array)
            {
                if(network_Entity.entityType == EntityType.Player || network_Entity.IsDead) { continue; }
                float distance = Vector3.Distance(RAPI.GetLocalPlayer().transform.position, network_Entity.transform.position);
                if(distance < currentDistance)
                {
                    currentDistance = distance;
                    currentEntity = network_Entity;
                }
            }
            if(currentEntity != null)
            {
                try
                {
                    ComponentManager<Network_Host>.Value.DamageEntity(currentEntity, currentEntity.transform, 9999f, currentEntity.transform.position, Vector3.up, EntityType.Player);
                    FindObjectOfType<RNotify>().AddNotification(RNotify.NotificationType.normal, "Successfully killed nearest entity ("+currentEntity.name+")!", 3, RNotify.CheckSprite);
                }
                catch { }
            }
            else
            {
                FindObjectOfType<RNotify>().AddNotification(RNotify.NotificationType.normal, "There is no nearby animals!", 3, RNotify.ErrorSprite);
            }

        });

        menu.transform.Find("Background").Find("Menus").Find("Islands").Find("RemoveButton").GetComponent<Button>().onClick.AddListener(() =>
        {
            ComponentManager<ChunkManager>.Value.ClearAllChunkPoints();
            FindObjectOfType<RNotify>().AddNotification(RNotify.NotificationType.normal, "Successfully cleared all landmarks!", 3, RNotify.CheckSprite);
        });

        InitAnimalsTab();
        InitIslandsTab();

        menu.GetComponent<CanvasGroup>().alpha = 0;
        menu.GetComponent<CanvasGroup>().interactable = false;
        menu.GetComponent<CanvasGroup>().blocksRaycasts = false;

        RConsole.Log("ItemSpawner has been loaded!");
    }

