        List<AI_NetworkBehaviourType> currentlySupported = new List<AI_NetworkBehaviourType>();

        content.Find("Shark").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.Shark));
        currentlySupported.Add(AI_NetworkBehaviourType.Shark);
        content.Find("Seagull").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnSeagull());
        content.Find("StoneBird").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.StoneBird));
        currentlySupported.Add(AI_NetworkBehaviourType.StoneBird);
        content.Find("Pufferfish").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.PufferFish));
        currentlySupported.Add(AI_NetworkBehaviourType.PufferFish);
        content.Find("Llama").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.Llama));
        currentlySupported.Add(AI_NetworkBehaviourType.Llama);
        content.Find("Goat").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.Goat));
        currentlySupported.Add(AI_NetworkBehaviourType.Goat);
        content.Find("Chicken").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.Chicken));
        currentlySupported.Add(AI_NetworkBehaviourType.Chicken);
        content.Find("Boar").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.Boar));
        currentlySupported.Add(AI_NetworkBehaviourType.Boar);
        content.Find("Rat").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.Rat));
        currentlySupported.Add(AI_NetworkBehaviourType.Rat);
        content.Find("Bear").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.Bear));
        currentlySupported.Add(AI_NetworkBehaviourType.Bear);
        content.Find("MamaBear").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.MamaBear));
        currentlySupported.Add(AI_NetworkBehaviourType.MamaBear);
        content.Find("BugSwarm").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(AI_NetworkBehaviourType.BugSwarm_Bee));
        currentlySupported.Add(AI_NetworkBehaviourType.BugSwarm_Bee);

        GameObject AnimalPrefab = asset.LoadAsset<GameObject>("AnimalSlot");
        foreach (AI_NetworkBehaviourType animal in typeof(AI_NetworkBehaviourType).GetEnumValues())
        {
            if (animal == AI_NetworkBehaviourType.None || animal == AI_NetworkBehaviourType.TEST) { continue; }
            if (!currentlySupported.Contains(animal))
            {
                GameObject t = Instantiate(AnimalPrefab, content);
                t.name = animal.ToString();
                t.transform.Find("TopBar").Find("Label").GetComponent<TextMeshProUGUI>().text = animal.ToString();
                t.transform.Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnAnimal(animal));
            }
        }
    }

