        List<ChunkPointType> currentlySupported = new List<ChunkPointType>();

        content.Find("SmallIsland").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnLandmark(ChunkPointType.Landmark_Small));
        currentlySupported.Add(ChunkPointType.Landmark_Small);
