        currentlySupported.Add(ChunkPointType.Landmark_Big);
        content.Find("FloatingRaft").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnLandmark(ChunkPointType.Landmark_FloatingRaft));
        currentlySupported.Add(ChunkPointType.Landmark_FloatingRaft);
        content.Find("BalboaIsland").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnLandmark(ChunkPointType.Landmark_Balboa));
        currentlySupported.Add(ChunkPointType.Landmark_Balboa);
        content.Find("BoatIsland").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnLandmark(ChunkPointType.Landmark_Boat));
        currentlySupported.Add(ChunkPointType.Landmark_Boat);
        content.Find("PilotIsland").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnLandmark(ChunkPointType.Landmark_Pilot));
        currentlySupported.Add(ChunkPointType.Landmark_Pilot);
        content.Find("RadioTower").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnLandmark(ChunkPointType.Landmark_RadioTower));
        currentlySupported.Add(ChunkPointType.Landmark_RadioTower);
        content.Find("Vasagatan").Find("SpawnButton").GetComponent<Button>().onClick.AddListener(() => SpawnLandmark(ChunkPointType.Landmark_Vasagatan));
        currentlySupported.Add(ChunkPointType.Landmark_Vasagatan);

