    public void SpawnLandmark(ChunkPointType cpt)
    {
        if (!Semih_Network.IsHost)
        {
            FindObjectOfType<RNotify>().AddNotification(RNotify.NotificationType.normal, "You are not the host!", 3, RNotify.ErrorSprite);
            return;
        }
        SO_ChunkSpawnRuleAsset ruleFromPointType = ComponentManager<ChunkManager>.Value.GetRuleFromPointType(cpt);
        if (ruleFromPointType)
        {
            int value = 200;
            switch (cpt)
            {
                case ChunkPointType.Landmark_Balboa:
                    value = 400;
                    break;
            }

            ComponentManager<ChunkManager>.Value.AddChunkPointCheat(cpt, Raft.direction * value);
            FindObjectOfType<RNotify>().AddNotification(RNotify.NotificationType.normal, "Landmark successfully spawned!", 3, RNotify.CheckSprite);
        }
        else
        {
            FindObjectOfType<RNotify>().AddNotification(RNotify.NotificationType.normal, "This island is in the game but isn't fully implemented currently!", 3, RNotify.ErrorSprite);
        }
    }

    public void Update()
    {
        if (Semih_Network.InLobbyScene || !asset) { return; }
        if (Input.GetKeyDown(menuKey) || (Input.GetKeyDown(KeyCode.Escape) && isShown))
        {
            isShown = !isShown;
            SelectTab("GameItems");
            menu.GetComponent<CanvasGroup>().alpha = isShown ? 1 : 0;
            menu.GetComponent<CanvasGroup>().interactable = isShown;
            menu.GetComponent<CanvasGroup>().blocksRaycasts = isShown;
            RAPI.ToggleCursor(isShown);
        }

        if (isShown)
        {
            if (!modded_amountinputfield || !game_amountinputfield) { return; }
            if (CurrentAmount <= 0)
            {
                CurrentAmount = 1;
                modded_amountinputfield.text = CurrentAmount.ToString();
                game_amountinputfield.text = CurrentAmount.ToString();
            }
            if (modded_amountinputfield.text == "")
            {
                modded_amountinputfield.text = CurrentAmount.ToString();
            }

            if (game_amountinputfield.text == "")
            {
                game_amountinputfield.text = CurrentAmount.ToString();
            }
        }
    }

    public void SpawnSeagull()
    {
        if (!Semih_Network.IsHost)
        {
            FindObjectOfType<RNotify>().AddNotification(RNotify.NotificationType.normal, "You are not the host!", 3, RNotify.ErrorSprite);
            return;
        }
        GameModeValueManager.GetCurrentGameModeValue().seagullVariables.shouldSpawn = true;
        ComponentManager<Network_Host_Entities>.Value.CreateSeagull(RAPI.getLocalPlayer().transform.position + RAPI.getLocalPlayer().transform.forward * 2, SaveAndLoad.GetUniqueObjectIndex(), SaveAndLoad.GetUniqueObjectIndex(), NetworkUpdateManager.GetUniqueBehaviourIndex());
    }

    public async void SpawnAnimal(AI_NetworkBehaviourType animal)
    {
        if (!Semih_Network.IsHost)
        {
            FindObjectOfType<RNotify>().AddNotification(RNotify.NotificationType.normal, "You are not the host!", 3, RNotify.ErrorSprite);
            return;
        }

        if (RAPI.GetLocalPlayer().transform.ParentedToRaft())
        {
            if (animal == AI_NetworkBehaviourType.Chicken || animal == AI_NetworkBehaviourType.Goat || animal == AI_NetworkBehaviourType.Llama)
            {
                AI_NetworkBehaviour_Domestic spawned = ComponentManager<Network_Host_Entities>.Value.CreateAINetworkBehaviour(animal, RAPI.GetLocalPlayer().transform.position + RAPI.GetLocalPlayer().transform.forward * 2) as AI_NetworkBehaviour_Domestic;
                spawned.QuickTameLate();
            }
            else if (animal == AI_NetworkBehaviourType.Shark || animal == AI_NetworkBehaviourType.PufferFish || animal == AI_NetworkBehaviourType.BugSwarm_Bee)
            {
                AI_NetworkBehaviour spawned = ComponentManager<Network_Host_Entities>.Value.CreateAINetworkBehaviour(animal, RAPI.GetLocalPlayer().transform.position + RAPI.GetLocalPlayer().transform.forward * 2);
            }
            else
            {
                FindObjectOfType<RNotify>().AddNotification(RNotify.NotificationType.normal, "This animal can only be spawned on an island!", 5, RNotify.ErrorSprite);
            }
        }
        else
        {
            try
            {
                AI_NetworkBehaviour_Domestic spawned = ComponentManager<Network_Host_Entities>.Value.CreateAINetworkBehaviour(animal, RAPI.GetLocalPlayer().transform.position + RAPI.GetLocalPlayer().transform.forward * 2) as AI_NetworkBehaviour_Domestic;
                spawned.QuickTameLate();
            }
            catch
            {
                AI_NetworkBehaviour spawned = ComponentManager<Network_Host_Entities>.Value.CreateAINetworkBehaviour(animal, RAPI.GetLocalPlayer().transform.position + RAPI.GetLocalPlayer().transform.forward * 2);
            }
        }
    }


    public void GiveItem(Item_Base item, int amount)
    {
        RAPI.GetLocalPlayer().Inventory.AddItem(item.UniqueName, amount);
    }

    public void SpawnItem(Item_Base item, int amount)
    {
        Network_Player player = RAPI.GetLocalPlayer();
        Helper.DropItem(new ItemInstance(item, amount, item.MaxUses), player.transform.position, player.CameraTransform.forward, player.transform.ParentedToRaft());
    }

    public void SelectTab(string name)
    {
        CurrentTab = name;
        switch (name)
        {
            case "GameItems":
                gameitems_searchterm = "";
                menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("Searchbar").GetComponent<TMP_InputField>().text = "";
                menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("Searchbar").GetComponent<TMP_InputField>().OnDeselect(null);
                InitGameItemsTab();
                break;
            case "ModdedItems":
                moddeditems_searchterm = "";
                menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("Searchbar").GetComponent<TMP_InputField>().text = "";
                menu.transform.Find("Background").Find("Menus").Find("ModdedItems").Find("Searchbar").GetComponent<TMP_InputField>().OnDeselect(null);
                InitModdedItemsTab();
                break;
        }
        menu.transform.Find("Background").Find("Menus").Find("Animals").GetComponentsInChildren<EventTrigger>().ToList().ForEach((t) => t.transform.Find("SpawnButton").gameObject.SetActive(false));
        menu.transform.Find("Background").Find("Menus").Find("Islands").GetComponentsInChildren<EventTrigger>().ToList().ForEach((t) => t.transform.Find("SpawnButton").gameObject.SetActive(false));
        foreach (Transform t in menu.transform.Find("Background").Find("Menus"))
        {
            t.gameObject.SetActive(t.transform.name == name);
        }
    }

    public void InitGameItemsTab()
    {
        ResetGameItemsCurrentItem();
        GameObject content = menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("ScrollView").Find("Viewport").Find("Content").gameObject;
        foreach (Transform t in content.transform)
        {
            Destroy(t.gameObject);
        }
        foreach (Item_Base item in ItemManager.GetAllItems())
        {
            if (item.UniqueIndex <= 500)
            {
                if (item.settings_Inventory.DisplayName.ToLower().Contains(gameitems_searchterm.ToLower()) && item.settings_Inventory.DisplayName.ToLower() != "an item")
                {
                    GameObject itemInstance = Instantiate(ItemPrefabEntry, content.transform);
                    itemInstance.transform.Find("Icon").GetComponent<Image>().sprite = item.settings_Inventory.Sprite;
                    itemInstance.GetComponent<Button>().onClick.AddListener(() =>
                    {
                        foreach (Transform t in content.transform)
                        {
                            t.GetComponent<Button>().interactable = true;
                        }
                        itemInstance.GetComponent<Button>().interactable = false;
                        SelectGameItemsCurrentItem(item);
                    });
                }
            }
        }
    }

    public void SelectGameItemsCurrentItem(Item_Base item)
    {
        CurrentItem = item;
        CurrentAmount = 1;
        game_amountinputfield.text = CurrentAmount.ToString();
        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("Name").GetComponent<TextMeshProUGUI>().text = "Name : <color=#bdc3c7>" + item.settings_Inventory.DisplayName + "</color>";
        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("Description").GetComponent<TextMeshProUGUI>().text = "Description : <color=#bdc3c7>" + item.settings_Inventory.Description + "</color>";
        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("StackSize").GetComponent<TextMeshProUGUI>().text = "Stack Size : <color=#bdc3c7>" + item.settings_Inventory.StackSize.ToString() + "</color>";
        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").Find("Sprite").GetComponent<Image>().sprite = item.settings_Inventory.Sprite;
        menu.transform.Find("Background").Find("Menus").Find("GameItems").Find("GiveCategory").GetComponent<CanvasGroup>().interactable = true;
